  false,\n\t\"url\": null,\n\t\"notes\": \"Habitat Management Plans (HMPs) are dynamic
  working documents that provide refuge managers a decision-making process; guidance
  for the management of the refugeu2019s habitats; and long-term vision, continuity,
  and consistency for habitat management on refuge lands.  Each plan incorporates
  the role of the refugeu2019s habitats in international, national, regional, tribal,
  state, ecosystem, and refuge goals and objectives; guides the analysis and selection
  of specific habitat management strategies to achieve those habitat goals and objectives;
  and uses key data, scientific literature, expert opinion, and staff expertise. An
  HMP is a step-down management plan of the refugeu2019s Comprehensive Conservation
  Plan (CCP). The CCP describes the desired future conditions of a refuge or planning
  unit and provides long-range guidance and management direction to achieve the purpose(s)
  of the refuge; helps fulfill the mission of the System; maintains and, where appropriate,
  restores the biological integrity, diversity, and environmental health of each refuge
  within the System; helps achieve the goals of the National Wilderness Preservation
  System, if appropriate; and meets other mandates.  The CCP for Clarks River National
  Wildlife Refuge (NWR) was completed in 2013 (USFWS 2013).\",\n\t\"license_title\":
